{"explainerData": {"api_calls": 10, "chat_history": ["[agent] Hi I am explainer bot. I am here to help you with your queries. Ask me anything, some sample questions are also accessible via hint button.", "[user] why is he credit worht", "[agent] The credit worthiness of the individual in question is influenced by several factors according to the SHAP values provided. The most significant positive contributors to the credit decision are the loan amount and the applicant's credit history. The property area and applicant income also play substantial roles in enhancing the credit profile. On the other hand, the individual's education level as a non-graduate negatively impacts the credit decision, although to a lesser extent compared to the positive factors. Other factors such as coapplicant income, self-employed status, loan amount term, dependents, gender, and marital status have relatively minor effects on the credit decision. 

Overall, the individual's credit worthiness is primarily supported by the loan amount, credit history, property area, and applicant income, which outweigh the negative impact from the education level. .", "[user] i think his income is lower than expected ", "[agent] The applicant's income has a positive impact on the prediction of being credit worthy, although it is not the most influential factor. The most significant factors affecting the prediction are the loan amount and credit history. The property area also plays a notable role. Despite the applicant's income being lower than expected, the positive credit history and the loan amount have a stronger influence in determining credit worthiness.

