{"explainerData": {"api_calls": 24, "chat_history": ["[agent] Hi I am explainer bot. I am here to help you with your queries. Ask me anything, some sample questions are also accessible via hint button.", "[user] What features are important to decide this application?", "[agent] The most important features to decide on this loan application are Credit History, Coapplicant Income, Dependents, and Married status. These features have the highest SHAP values, indicating their strong impact on the decision-making process for this specific application. .", "[user] In what ways the applicant may be 'not credit worthy'?", "[agent] The applicant may be considered 'not credit worthy' if their credit history changes from 'Yes' to 'No'. This indicates that having a negative credit history is a significant factor in determining credit worthiness. ", "[user] How the loan term will effect this applicant in a negative way?", "[agent] The analysis of the effect of varying the loan term on the applicant's creditworthiness shows that as the loan term increases, the probability of being considered creditworthy generally decreases. Specifically, shorter loan terms such as 12, 36, 60, and 84 months have a higher probability of the applicant being considered creditworthy, around 71.69%. As the loan term extends to 120 and 180 months, the probability of being creditworthy slightly increases to about 72.27% and 73.43%, respectively.

However, further increasing the loan term to 240 months maintains a similar probability of 73.54%. When the loan term reaches 300 months, there is a noticeable drop in creditworthiness to 69.70%, and this trend worsens at 360 months with a probability of 71.24%. The most significant decrease is observed at 480 months, where the probability of being creditworthy drops to 64.74%.

